import '../App.css';
import React from 'react'
import Logo from '../Assets/bolt_logo.png'
import { Navbar , Container} from 'react-bootstrap';

const Header = () => {
    return (
        <div className='Header'>
        <Container>
          <Navbar.Brand href="#home">
            <img 
              alt=""
              src={Logo}
              width="100"
              height="60"
              className="Main-Logo"
            />{' '}
            React Bootstrap
          </Navbar.Brand>
        </Container>
        </div>
    )
}

export default Header
